;; **
;;; ## Sine curve
;; **

;; @@
(def data-sin (map (fn [x] [[x] (+ (Math/cos (/ x 3)) (Math/sin (/ x 5)))]) (range 40)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.simple-sr/data-sin</span>","value":"#'algebolic.demo.simple-sr/data-sin"}
;; <=

;; @@
(def run-config
  (let [vars '[x]
        functions (expression/get-function-symbols #{:plus :minus :times :sin :cos})
        terminals (expression/make-terminals vars)
        ea-config (sso/sso-ea-config
                    {:tournament-size 5
                     :goal :error-pp
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover 80) :repeat 25}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 5) :repeat 10}
                                 {:op identity :repeat 40}]})]
    {:initial-zeitgeist      (evolution/make-zeitgeist
                               (genetics/ramped-half-and-half-population functions terminals 100 8))
     :ea-config              ea-config
     :score-functions        {:complexity (memoize score/size)
                              :error (memoize (partial score/abs-error vars data-sin))
                              :error-pp (memoize (partial score/abs-error-pp vars data-sin 0.08))}
     :stopping-condition     #(>= (:age %) 500)
     :reporting-function     (fn [z] (print ".") (flush))}))
